import stock_loading from '../icons/stock_loading.jpeg';
import '../App.css';

function Stock_loading() {

    return (
        <div className="App">
          <header className="App-header">
            <img src={stock_loading} className="App-logo" alt="logo" />
          </header> 
        </div> 
    );  

}
export default Stock_loading;
